B.KQ=new A.bp(B.d6,["Kay\u0131\u015f S\xfcrtmesi","\ud83d\udd04","orta","V-kay\u0131\u015f veya triger kay\u0131\u015f\u0131nda s\xfcrtme/kayma tespit edildi. Genellikle so\u011fuk havalarda veya motor ilk \xe7al\u0131\u015ft\u0131\u011f\u0131nda belirgin olan c\u0131z\u0131rt\u0131l\u0131 ses.",B.HS,B.Ih,"Kay\u0131\u015f kopabilir ve bu durumda direksiyon a\u011f\u0131rla\u015f\u0131r, klima \xe7al\u0131\u015fmaz, motor a\u015f\u0131r\u0131 \u0131s\u0131nabilir. Triger kay\u0131\u015f\u0131 koparsa motor ciddi hasar g\xf6r\xfcr.","30 dk - 2 saat"],t.yf)
