B.KT=new A.bp(B.d6,["Su Pompas\u0131 Ar\u0131zas\u0131","\ud83d\udca7","yuksek","So\u011futma sistemi su pompas\u0131ndan anormal ses geliyor. Pompa rulman\u0131 a\u015f\u0131nm\u0131\u015f veya pervane hasarl\u0131 olabilir.",B.IZ,B.Ia,"Motor a\u015f\u0131r\u0131 \u0131s\u0131n\u0131r ve conta ataca\u011f\u0131 yapar. Silindir kapa\u011f\u0131 \xe7arp\u0131labilir. Motor tamamen ar\u0131zalanabilir. Yolda kalma riski y\xfcksektir.","2-4 saat"],t.yf)
